import React, { useEffect, useState } from "react";
import axios from "axios";

const OrderContact = () => {
  const [contacts, setContacts] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/foods/contacts")
      .then((res) => setContacts(res.data.contacts || []));
  }, []);

  return (
    <div
      style={{
        maxWidth: 400,
        margin: "60px auto",
        padding: 24,
        borderRadius: 12,
        boxShadow: "0 2px 12px #eee",
        background: "#fff",
        textAlign: "center",
      }}
    >
      <h2>Place Your Order by Call</h2>
      <p style={{ marginBottom: 20, color: "#666" }}>
        Call one of the numbers below to place your order:
      </p>
      {contacts.length === 0 ? (
        <p>No contact numbers available.</p>
      ) : (
        <ul style={{ listStyle: "none", padding: 0 }}>
          {contacts.map((contact) => (
            <li key={contact._id} style={{ marginBottom: 12 }}>
              <a
                href={`tel:${contact.number}`}
                style={{
                  color: "#222",
                  fontWeight: "bold",
                  fontSize: 18,
                  textDecoration: "underline",
                }}
              >
                {contact.number}
              </a>
            </li>
          ))}
        </ul>
      )}
      <p style={{ marginTop: 30, color: "#aaa", fontSize: 13 }}>
        Thank you for choosing Shri Shyam Bhojnalaya!
      </p>
    </div>
  );
};

export default OrderContact;
